/* <<< oracle >>> */
static void algoInner_oracle(ex12_Work *work, ex12_Params *params, realtype *z, realtype *fval, realtype *grad) {
    realtype hz[300];
    {
        /* (hz):= (work->Prob.H)^T*(z);   // (300x300)*(300x1) */
        {
            int k;
            for (k=0; k<300; ++k) {
              hz[k] = (+work->Prob.H[k]) * z[k];
            }
        }
    }

    if (NULL!=fval) {
        int i;
        realtype tmp;
        tmp = 0.0;
        for (i=0; i<300; ++i) {
          tmp += (0.5*hz[i] + work->Prob.inner_g[i]) * z[i];
        }
        fval[0] = tmp + work->Prob.inner_c[0];
    }

    if (NULL!=grad) {
        int i;
        for (i=0; i<300; ++i) {
          grad[i] = hz[i] + work->Prob.inner_g[i];
        }
    }
}
static void algoOuter_oracle(ex12_Work *work, ex12_Params *params, realtype *v, realtype *fval, realtype *grad, ex12_Settings *settings) {
    /* << data of inner problem >> */
    {
        /* (work->Prob.inner_g):= (work->Prob.Ae)^T*(v)+(params->g);   // (300x200)*(200x1),(300x1) */
        int i,k;
        realtype tmp;
        for (i=0; i<300; ++i) {
            tmp = 0.0;
            for (k=0; k<200; ++k) {
              tmp += work->Prob.Ae[k+i*200]*v[k];
            }
            work->Prob.inner_g[i] = tmp + params->g[i];
        }
    }
    {
        /* (work->Prob.inner_c):= -(v)^T*(params->be)+(params->c);   // (1x200)*(200x1),(1x1) */
        int k;
        realtype tmp;
            tmp = 0.0;
            for (k=0; k<200; ++k) {
              tmp -= v[k]*params->be[k];
            }
            work->Prob.inner_c[0] = tmp + params->c[0];
    }

    /* << inner algorithm >> */
    /* AlgoFgm */
    {
        int stopgNext;
        stopgNext = 1;
        work->algoInner.res_stopcode = 0;
        {
            realtype z[300];
            realtype zp[300];
            realtype y[300];
            realtype grad[300];
            int iter;
            int icoord;
            realtype alpha,alpha_p;
            realtype aamul,muLinv;
            realtype beta;
            
            iter =0;
            
            copyvec300(z,work->algoInner.init);  /* (z):=(work->algoInner.init) */
            copyvec300(y,z);  /* (y):=(z) */
            alpha = 1;
            muLinv = work->algoInner.glob_mu*work->algoInner.glob_Linv;
            copyvec300(zp,z);  /* (zp):=(z) */
            
            while (iter<settings->algoInner.maxit) {
                ++iter;
            
                algoInner_oracle(work,params,y,NULL,grad);
                for (icoord=0; icoord<300; ++icoord) {
                    zp[icoord] = y[icoord] - work->algoInner.glob_Linv*grad[icoord];
                }
                algoInner_project(zp,work,params);
            
                if (iter==stopgNext) {
                    int icoord;
                    realtype gradmapi;
                    realtype normsq;
                    normsq = 0;
                    for (icoord=0; icoord<300; ++icoord) {
                        gradmapi=(y[icoord]-zp[icoord]);
                        normsq += gradmapi * gradmapi;
                    }
                    normsq *= 1.0/(work->algoInner.glob_Linv*work->algoInner.glob_Linv);
                    if ( settings->algoInner.stopgEps>=0 && normsq <= settings->algoInner.stopgEps * settings->algoInner.stopgEps ) {
                        work->algoInner.res_stopcode = 2;
                        break;
                    }
                    stopgNext += settings->algoInner.stopgStride;
                }
            
                aamul = alpha*alpha - muLinv;
                alpha_p= -0.5 * aamul + sqrt( aamul*aamul * 0.25 + alpha*alpha);
                beta = alpha*(1-alpha)/(alpha*alpha+alpha_p);
            
                for (icoord=0; icoord<300; ++icoord) {
                    y[icoord] = zp[icoord] + beta*(zp[icoord]-z[icoord]);
                }
            
                copyvec300(z,zp);  /* (z):=(zp) */
                alpha = alpha_p;
            }
            copyvec300(work->algoInner.res_z,zp);  /* (work->algoInner.res_z):=(zp) */
            work->algoInner.res_iter = iter;
        }
    }

    /* << outer gradient >> */
    if (NULL!=grad) {
        {
            /* (grad):= (work->Prob.Ae)*(work->algoInner.res_z)-(params->be);   // (200x300)*(300x1),(200x1) */
            int i,k;
            realtype tmp;
            for (i=0; i<200; ++i) {
                tmp = 0.0;
                for (k=0; k<300; ++k) {
                  tmp += work->Prob.Ae[i+k*200]*work->algoInner.res_z[k];
                }
                grad[i] = tmp - params->be[i];
            }
        }
    }

    /* << dual function value >> */
    if (NULL!=fval) {
        algoInner_oracle(work,params,work->algoInner.res_z,fval,NULL);
    }

}

/* <<< SOLVE >>> */
void ex12_solve(ex12_Params *params, ex12_Settings *settings, ex12_Result *result, ex12_Work *work) {

    /* << prepare data >> */
    {
        /* === initial points === */
        copyvec300(work->algoInner.init,settings->algoInner.init);  /* (work->algoInner.init):=(settings->algoInner.init) */
        algoInner_project(work->algoInner.init,work,params);
        copyvec200(work->algoOuter.init,settings->algoOuter.init);  /* (work->algoOuter.init):=(settings->algoOuter.init) */
        
    }

    /* << main algorithm >> */
    /* AlgoFgm */
    {
        int stopgNext;
        stopgNext = 1;
        work->algoOuter.res_stopcode = 0;
        {
            realtype z[200];
            realtype zp[200];
            realtype y[200];
            realtype grad[200];
            int iter;
            int icoord;
            realtype alpha,alpha_p;
            realtype beta;
            
            iter =0;
            
            copyvec200(z,work->algoOuter.init);  /* (z):=(work->algoOuter.init) */
            copyvec200(y,z);  /* (y):=(z) */
            alpha = 1;
            copyvec200(zp,z);  /* (zp):=(z) */
            
            while (iter<settings->algoOuter.maxit) {
                ++iter;
            
                algoOuter_oracle(work,params,y,NULL,grad,settings);
                if ( 1==settings->approach.warmstartInner) {  /* reinit inner */
                    copyvec300(work->algoInner.init,work->algoInner.res_z);  /* (work->algoInner.init):=(work->algoInner.res_z) */
                }
                for (icoord=0; icoord<200; ++icoord) {
                    zp[icoord] = y[icoord] + work->algoOuter.glob_Linv*grad[icoord];
                }
            
                if (iter==stopgNext) {
                    int icoord;
                    realtype gradmapi;
                    realtype normsq;
                    normsq = 0;
                    for (icoord=0; icoord<200; ++icoord) {
                        gradmapi=(y[icoord]-zp[icoord]);
                        normsq += gradmapi * gradmapi;
                    }
                    normsq *= 1.0/(work->algoOuter.glob_Linv*work->algoOuter.glob_Linv);
                    if ( settings->algoOuter.stopgEps>=0 && normsq <= settings->algoOuter.stopgEps * settings->algoOuter.stopgEps ) {
                        work->algoOuter.res_stopcode = 2;
                        break;
                    }
                    stopgNext += settings->algoOuter.stopgStride;
                }
            
                alpha_p= 0.5*alpha*(sqrt(alpha*alpha+4)-alpha);
                beta = alpha*(1-alpha)/(alpha*alpha+alpha_p);
            
                for (icoord=0; icoord<200; ++icoord) {
                    y[icoord] = zp[icoord] + beta*(zp[icoord]-z[icoord]);
                }
            
                copyvec200(z,zp);  /* (z):=(zp) */
                alpha = alpha_p;
            }
            copyvec200(work->algoOuter.res_z,zp);  /* (work->algoOuter.res_z):=(zp) */
            work->algoOuter.res_iter = iter;
        }
    }
    
    
    /* << finalize result >> */
    copyvec200(result->la,work->algoOuter.res_z);  /* (result->la):=(work->algoOuter.res_z) */
    algoOuter_oracle(work,params,work->algoOuter.res_z,&(result->d),NULL,settings);
    copyvec300(result->x,work->algoInner.res_z);  /* (result->x):=(work->algoInner.res_z) */
    result->iter = work->algoOuter.res_iter;
    result->exitflag = work->algoOuter.res_stopcode;

}



